import React, { Component } from 'react';

class VoteAnswer extends React.Component {
    constructor() {
        super();
    }

    addVote = () => {
        this.props.answers
    }

    render() {
        return(
            <button type="submit" class="btn btn-primar">Answer</button>
        );
    }
};

export default VoteAnswer;
